import React, { useContext } from 'react';
import LogContext from '../ContextAPI/LogsAPI/LogContext';

const Techlist = () => {
    const context = useContext(LogContext);
    const { techs } = context;
    return (
        <div className='modal' id='tech-list'>
            <div className='modal-content'>
                <div className='colection with-header container'>
                    <h4 className='left'>Tchnicians :</h4>
                </div>
                <div className='row'>
                    {techs &&
                        techs.map(tech => (
                            <li
                                key={tech._id}
                                tech={tech}
                                className='collection-header'
                            >
                                <i className='material-icons left'>face</i>
                                <strong
                                    className='left'
                                    style={{ fontWeight: 'bolder' }}
                                >
                                    {tech.firstName + ' ' + tech.lastName}
                                </strong>
                                <a href='#!' className='secondary-content'>
                                    <i className='material-icons grey-text'>
                                        delete
                                    </i>
                                </a>
                                <br />
                            </li>
                        ))}
                </div>
            </div>
        </div>
    );
};

export default Techlist;
